function stat(marks) {
    let table = document.createElement("table");
    // –°–≥—Ä—É–ø–ø–∏—Ä—É–µ–º –¥–∞–Ω–Ω—ã–µ –ø–æ –≥—Ä—É–ø–ø–∞–º –∏ –ø—Ä–µ–¥–º–µ—Ç–∞–º
    const groupedData = marks.slice(1).reduce((grouped, mark) => {
        const [group, ...rest] = mark.split(';');
        grouped[group] = grouped[group] || [];
        grouped[group].push(...rest);
        return grouped;
    }, {});

    // –í—ã—á–∏—Å–ª—è–µ–º —Å—Ç–∞—Ç–∏—Å—Ç–∏–∫—É –¥–ª—è –∫–∞–∂–¥–æ–π –≥—Ä—É–ø–ø—ã –∏ –ø—Ä–µ–¥–º–µ—Ç–∞
    const groupStats = Object.entries(groupedData).map(([group, marks]) => {
        // –í—ã—á–∏—Å–ª—è–µ–º —Å—Ä–µ–¥–Ω—é—é –æ—Ü–µ–Ω–∫—É, –º–µ–¥–∏–∞–Ω—É, –∫–æ–ª–∏—á–µ—Å—Ç–≤–æ –∏ –ø—Ä–æ—Ü–µ–Ω—Ç —É—á–µ–Ω–∏–∫–æ–≤ –¥–ª—è –∫–∞–∂–¥–æ–π –æ—Ü–µ–Ω–∫–∏
        const scores = marks.map(Number).filter(score => !isNaN(score));
        const average = scores.reduce((sum, score) => sum + score, 0) / scores.length;
        const median = scores.sort((a, b) => a - b)[Math.floor(scores.length / 2)];
        const count = scores.filter(score => score !== '').length;
        const percentage = (count / marks.length) * 100;

        return [group, average, median, count, percentage];
    });

    // –û—Ç–æ–±—Ä–∞–∂–∞–µ–º —Å—Ç–∞—Ç–∏—Å—Ç–∏–∫—É –≤ —Ç–∞–±–ª–∏—Ü–µ
        let tr = document.createElement("tr");
    let headers = ['surname', 'average', 'median', 'count', 'percentage'];
    for (const header of headers) {
        let th = document.createElement("th");
        th.innerHTML = header;
        tr.appendChild(th);
    }
    table.appendChild(tr);
    for (const [group, average, median, count, percentage] of groupStats) {
        let tr = document.createElement("tr");

        let td0 = document.createElement("td");
        td0.innerHTML = group;
        tr.appendChild(td0);

        let td1 = document.createElement("td");
        td1.innerHTML = average.toFixed(2);
        tr.appendChild(td1);

        let td2 = document.createElement("td");
        td2.innerHTML = median;
        tr.appendChild(td2);

        let td3 = document.createElement("td");
        td3.innerHTML = count;
        tr.appendChild(td3);

        let td4 = document.createElement("td");
        td4.innerHTML = percentage.toFixed(2) + '%';
        tr.appendChild(td4);

        table.appendChild(tr);
    }

    let div = document.getElementById("content-3");
    div.innerHTML = '';;
    div.appendChild(table);
}

function displayChart() {
    // –ü–æ–ª—É—á–µ–Ω–∏–µ –¥–∞–Ω–Ω—ã—Ö –∏–∑ —Ñ—É–Ω–∫—Ü–∏–∏ stat
    const groupStats = stat(marks);
    const groupLabels = groupStats.map(group => group[0]);
    const averageScores = groupStats.map(group => group[1]);
    const medianScores = groupStats.map(group => group[2]);

    // –°–æ–∑–¥–∞–Ω–∏–µ –≥—Ä–∞—Ñ–∏–∫–∞ —Å –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–µ–º Chart.js
    const ctx = document.getElementById('myChart').getContext('2d');
    const myChart = new Chart(ctx, {
        type: 'bar',
        data: {
            labels: groupLabels,
            datasets: [{
                label: 'Average Scores',
                data: averageScores,
                backgroundColor: 'rgba(255, 99, 132, 0.2)',
                borderColor: 'rgba(255, 99, 132, 1)',
                borderWidth: 1
            },
            {
                label: 'Median Scores',
                data: medianScores,
                backgroundColor: 'rgba(54, 162, 235, 0.2)',
                borderColor: 'rgba(54, 162, 235, 1)',
                borderWidth: 1
            }]
        },
        options: {
            scales: {
                y: {
                    beginAtZero: true
                }
            }
        }
    });
    myChart.draw(data, options);
}

