def next_pos(char, prev, cur):
    match char:
        case "|":
            if cur[0] > prev[0]:
                return (cur[0] + 1, cur[1])
            else:
                return (cur[0] - 1, cur[1])
        case "-":
            if cur[1] > prev[1]:
                return (cur[0], cur[1] + 1)
            else:
                return (cur[0], cur[1] - 1)
        case "L":
            if prev[0] < cur[0]:
                return (cur[0], cur[1] + 1)
            else:
                return (cur[0] - 1, cur[1])
        case "J":
            if prev[0] < cur[0]:
                return (cur[0], cur[1] - 1)
            else:
                return (cur[0] - 1, cur[1])
        case "7":
            if prev[0] == cur[0]:
                return (cur[0] + 1, cur[1])
            else:
                return (cur[0], cur[1] - 1)
        case "F":
            if prev[0] == cur[0]:
                return (cur[0] + 1, cur[1])
            else:
                return (cur[0], cur[1] + 1)
        case _:
            return None


def traverse(cur, next, visited, final, dist=1):
    if next == final:
        return dist, visited
    if next in visited:
        return None
    visited.add(next)
    tmp = next
    next = next_pos(lines[next[0]][next[1]], cur, next)
    cur = tmp

    if next is None:
        return None

    if next[0] not in range(0, len(lines)):
        return None

    if next[1] not in range(0, len(lines[cur[0]])):
        return None

    return traverse(cur, next, visited, final, dist + 1)


