#include <iostream>
#include <string>
#include <sstream>

using namespace std;

class Node
{
	public:
		Node *left;
		Node *right;
		int val;
};


class BstTree
{
	public:
		Node* root;
		BstTree()
		{
			root = NULL;
		};
		void inOrderSeq();
		void postOrderSeq();
		void preOrderSeq();
		int bstInsert(int _val); // inserts _val to bstTree; returns 1 is _val is added (which may happen only when _val is not in bstTree) and 0 otherwise
		int bstDelete(int _val); // deletes _val from bstTree; returns 1 if _val gets deleted and 0 otherwise
		int bstSearch(int _val); // returns 1 if _val is in the bstTree and 0 otherwise
		~BstTree();
	private:
		void inOrder(Node *);
		void postOrder(Node *);
		void preOrder(Node *);
		void deleteNode(Node*);
};

BstTree::~BstTree()
{
	deleteNode(root);
}

void BstTree::deleteNode(Node* curr)
{
	if (curr!=NULL)
	{
		deleteNode(curr->left);
		deleteNode(curr->right);
		delete curr;
	}
}

int BstTree::bstInsert(int _val)
{
	if (bstSearch(_val)) return 0; //if _val is in the tree

	Node* curr = new Node();
	curr->val = _val;
	curr->left = NULL;
	curr->right = NULL;
	if (root == NULL)
	{
		root = curr;
		return 1;
	}
	else
	{
		Node * prev = NULL;
		Node* temp = root;
		bool leftChild = false;
		while( temp != NULL)
		{
			if (_val <= temp->val)
			{
				prev = temp;
				temp = temp->left;
				leftChild = true;
			}
			else
			{
				prev = temp;
				temp = temp->right;
				leftChild = false;
			}
		}

		if (leftChild)
			prev -> left = curr;
		else
			prev -> right = curr;
		return 1;
	}
}


int BstTree::bstSearch(int _val)
{
	Node* curr = root;
	while(curr != NULL)
	{
		if (curr-> val == _val)
			return 1;
		if (_val < curr->val)
			curr = curr -> left;
		else
			curr = curr -> right;
	}
	return 0;
}

int BstTree::bstDelete(int _val)
{
    //delete value from the tree
	//return 1 if value can be deleted and 0 otherwise
    
    // find the node
    Node* curr = root;
    Node** prev = &root;
    while (curr != NULL && _val != curr->val) {
        if (_val < curr->val) {
            prev = &(curr->left);
            curr = curr->left;
        }
        else {
            prev = &(curr->right);
            curr = curr->right;
        }
    }

    // node does not exit in the tree, nothing to delete
    if (curr == NULL) 
        return 0;

    Node* target = curr;
    if (curr->right == NULL) {
        *prev = curr->left;
        delete target;
        return 1;
    }
    
    prev = &(curr->right);
    curr = curr->right;
    while (curr->left != NULL) {
        prev = &(curr->left);
        curr = curr->left;
    }
    target->val = curr->val;
    *prev = curr->right;
    delete curr;
    return 1;
}

void BstTree::preOrderSeq()
{
	preOrder(root);
}

void BstTree::preOrder(Node * curr)
{
	cout << curr->val << " ";
	if (curr->left != NULL)
		preOrder(curr->left);
	if (curr->right != NULL)
		preOrder(curr->right);
}

void BstTree::inOrderSeq()
{
	inOrder(root);
}

void BstTree::inOrder(Node * curr)
{
	if (curr->left != NULL)
		inOrder(curr->left);
	cout << curr->val <<" ";
	if (curr->right != NULL)
		inOrder(curr->right);
}

void BstTree::postOrderSeq()
{
	postOrder(root);
}

void BstTree::postOrder(Node * curr)
{
	if (curr->left != NULL)
		postOrder(curr->left);
	if (curr->right != NULL)
		postOrder(curr->right);
	cout << curr->val <<" ";
}


